// React component: The Spread by Week (Tab 3)
import React, { useState } from 'react';

const SpreadByWeekPage = () => {
  const [selectedWeek, setSelectedWeek] = useState('Current');

  const spreadData = {
    'Current': [
      { date: 'Aug 31', time: '7:00 PM', team1: 'Roughriders (+3.5)', team2: 'Stampeders (-3.5)' },
      { date: 'Sep 1', time: '1:00 PM', team1: 'Bears (+1.5)', team2: 'Packers (-1.5)' },
    ],
    'Week 1': [
      { date: 'Aug 31', time: '7:00 PM', team1: 'Roughriders (+3.5)', team2: 'Stampeders (-3.5)' },
    ],
    'Week 2': [],
  };

  const currentGames = spreadData[selectedWeek] || [];

  return (
    <div className="p-4 border rounded shadow bg-white">
      <h2 className="text-xl font-bold mb-4">🗂️ The Spread by Week</h2>

      <div className="flex items-center gap-4 mb-4">
        <button className="bg-gray-300 px-4 py-2 rounded">🖨️ Press to Print the Spread Sheet</button>
        <label className="font-semibold">Select Week:</label>
        <select
          value={selectedWeek}
          onChange={(e) => setSelectedWeek(e.target.value)}
          className="border p-2"
        >
          <option>Current</option>
          <option>Week 1</option>
          <option>Week 2</option>
          <option>Week 3</option>
          <option>Week 4</option>
          <option>Week 5</option>
          <option>Week 6</option>
          <option>Week 7</option>
          <option>Week 8</option>
          <option>Week 9</option>
          <option>Week 10</option>
          <option>Week 11</option>
          <option>Week 12</option>
          <option>Week 13</option>
          <option>Week 14</option>
          <option>Week 15</option>
          <option>Week 16</option>
        </select>
      </div>

      {currentGames.length > 0 ? (
        <table className="w-full table-auto border">
          <thead>
            <tr>
              <th className="border px-2">Date</th>
              <th className="border px-2">Time</th>
              <th className="border px-2">Team 1 (spread)</th>
              <th className="border px-2">Team 2 (spread)</th>
            </tr>
          </thead>
          <tbody>
            {currentGames.map((game, index) => (
              <tr key={index}>
                <td className="border px-2">{game.date}</td>
                <td className="border px-2">{game.time}</td>
                <td className="border px-2">{game.team1}</td>
                <td className="border px-2">{game.team2}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p className="text-red-600 font-semibold mt-4">❗ There is no spread data for the selected week, please select a different week.</p>
      )}
    </div>
  );
};

export default SpreadByWeekPage;
